import React from 'react';
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper, Button } from '@mui/material';

const ProyectosUsuarios = () => {
  const filas = [
    { nombre: 'Nombre1', usuario: 'Usuario 1', perfil: 'Admin' },
    // ... otros datos
  ];

  const tableContainerStyle = {
    marginTop: '50px',
    marginRight: '80px',
    fontFamily: 'Rajdhani, sans-serif', // Fuente Rajdhani para toda la tabla
  };

  const headerCellStyle = {
    fontWeight: 'bold', // Texto en negrita para la cabecera
  };

  const buttonStyle = {
    backgroundColor: '#FFF',
    color: '#DA291C',
    border: '1px solid #DA291C',
  };

  return (
    <TableContainer component={Paper} style={tableContainerStyle}>
      <Table aria-label="tabla de proyectos y usuarios">
        <TableHead>
          <TableRow>
            <TableCell style={headerCellStyle}>Nombre</TableCell>
            <TableCell style={headerCellStyle}>Usuario</TableCell>
            <TableCell style={headerCellStyle}>Perfil</TableCell>
            <TableCell style={headerCellStyle}>Accion</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {filas.map((fila, index) => (
            <TableRow key={index}>
              <TableCell>{fila.nombre}</TableCell>
              <TableCell>{fila.usuario}</TableCell>
              <TableCell>{fila.perfil}</TableCell>
              <TableCell>
                <Button 
                  variant="contained" 
                  style={buttonStyle}
                  startIcon={<img src="images/eliminarIcon.svg" alt="Eliminar" />}
                >
                  Eliminar
                </Button>
              </TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
};

export default ProyectosUsuarios;
